**popup.html**
```html
<!DOCTYPE html>
<html>
  <head>
    <title>Screenshot Saver</title>
    <style>
      body {
        width: 200px;
        height: 100px;
        font-family: Arial, sans-serif;
        text-align: center;
      }
    </style>
  </head>
  <body>
    <h1>Screenshot Saver</h1>
    <button id="take-screenshot">Take Screenshot</button>
    <script src="popup.js"></script>
  </body>
</html>
```
**popup.js**
```javascript
document.addEventListener("DOMContentLoaded", function () {
  const takeScreenshotButton = document.getElementById("take-screenshot");
  takeScreenshotButton.addEventListener("click", function () {
    chrome.tabs.query({ active: true, currentWindow: true }, function (tabs) {
      chrome.tabs.sendMessage(tabs[0].id, { action: "take-screenshot" });
    });
  });
});
```
**contentScript.js**
```javascript
chrome.runtime.onMessage.addListener(function (request, sender, sendResponse) {
  if (request.action === "take-screenshot") {
    chrome.tabs.captureVisibleTab(null, { format: "png" }, function (dataUrl) {
      const screenshot = new Uint8Array(dataUrl.split(",")[1].length);
      for (let i = 0; i < screenshot.length; i++) {
        screenshot[i] = dataUrl.split(",")[1].charCodeAt(i);
      }
      const blob = new Blob([screenshot], { type: "image/png" });
      const url = URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = "screenshot.png";
      a.click();
      URL.revokeObjectURL(url);
    });
  }
});
